package SeleniumBasicsday2;

public class learncontinue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//continue statement
for (int i = 0; i <=10; i++) {
	if (i==7) {
		continue;
			}
	System.out.println(i);
}
System.out.println("Out of the loop");
	}

}
